import React from 'react';
import '../style/Header.css'

function Header() {
    return (
        <div class="container">
            <br />
            <h1><b>Academic Team Score Keeper</b></h1>
            <h3>Use this platform to help keep track of scores during scrimmages.</h3>
        </div>
    );
}

export default Header;
